function calculateDominicanPayroll(e){if("number"!=typeof e)return null;const t={threshold:34685,rate:.15,fixedAmount:0},o={threshold:52027.4167,rate:.2,fixedAmount:2601.33},r={threshold:72260.25,rate:.25,fixedAmount:6648},h=.0304*(e>156e3?156e3:e),l=.0287*(e>312e3?312e3:e);let n=0;const s=e-(h+l);if(s>t.threshold&&s<=o.threshold){const e=s-t.threshold;n=t.fixedAmount+e*t.rate}else if(s>o.threshold&&s<=r.threshold){const e=s-o.threshold;n=o.fixedAmount+e*o.rate}else if(s>r.threshold){const e=s-r.threshold;n=r.fixedAmount+e*r.rate}const d=h+l+n;return{monthlySalary:e,netMonthlySalary:e-d,sfs:h,afp:l,isr:n,deductions:d}}